import './App.css';
import Card from './Card.js';

function App() {
    return (
        <div style = { {display:'flex' } }>
            <Card title = {'Title 1'}
            subtitle= {'Apples'}
            description = {'React Practice:'}
            background = {'blue'}
            width = {100}
            /> 
            <Card title = {'Title 2'}
            subtitle= {'Peaches'}
            description = {'Making Cards'}
            background = {'red'}
            width = {100}
            />
            <Card title = {'Title 3'}
            subtitle= {'Pears'}
            description = {'With Some'}
            background = {'green'}
            width = {100}
            />
            <Card title = {'Title 4'}
            subtitle= {'Banana'}
            description = {'Inline Styling.'}
            background = {'purple'}
            width = {100}
            />
        </div>
    );
  };


export default App;
